dex":0}},"videoDetails":{"videoId":"Do7ZdUodDdw","title":"HOW TO MAKE VEGETABLE BIRYANI (STEP BY STEP GUIDE FOR BEGINNERS)","lengthSeconds":"750","channelId":"UCc5O8GaMvAGjmvENEvvqZrg","isOwnerViewing":false,"shortDescription":"How To Cook Vegetable Biryani - Restaurant Style Vegetable Biryani Recipe - Perfect Vegetable Biryani\nThere are several tricks that go into making a perfect biryani. If you follow these steps then you will soon master it and will be really proud of yourself. I feel this vegetable biryani tastes equally good like chicken or mutton biryani.\n🔔Please click on the link below and subscribe to Curries With Bumbi so that I can bring more new recipes for you-- https://www.youtube.com/channel/UCc5O8GaMvAGjmvENEvvqZrg\n\nIngredients required for making vegetable biryani -\nFor cooking rice - Serves 3 to 4\n* 500 gm/1 lb/ 2 cups (standard measuring cup) of long grained Basmati rice\n* 2 tablespoons salt\n* 2 dried bay leaves\n* 1 cinnamon stick\n* 3 to 4 green cardamoms\n* 8 to 10 cloves\n* 1 tablespoon lime/lemon juice\n* 1 tablespoon oil\nFor making the vegetable curry and layering rice - Please note the weight of rice should be more or less equal to the weight of veggies taken.\n* 200 gm/7 oz cauliflower\n* 100 gm/ 4 oz / 1 medium to large potato\n* 108 gm/ 4oz/ 2 medium carrots\n* 30 gm/1/4 th cup frozen green peas. Add it after the vegetable curry is done if using frozen ones. If using fresh green peas, add them along with other vegetables before marination.\n* 60 gm/ 2 oz green beans\n* 2 large onions \n* 1 cup plain unflavored yogurt\n* 1 teaspoon shahi jeera (black cumin seeds)\n* 1/2 teaspoon turmeric powder\n* 1 tablespoon kashmiri red chilli powder\n* 1 tablespoon ground coriander (dhania powder)\n* 20 gm ginger/ 1 tablespoon finely grated\n* 20 gm / 6 large garlic cloves/ 1 tablespoon finely grated\n* 1/3 rd cup oil\n* 1 tablespoon ghee for making curry + 2 tablespoons will go on rice while layering\n* 1 dried bay leaf\n* 2 to 3 green cardamoms\n* 1 cinnamon stick\n* 20 to 30 fresh mint leaves\n* 1 tablespoon Kewra water. Please note if using Kewra essence just use 2 to 3 drops\n* 1 to 2 teaspoons rose water \n* 3/4 th cup rice water\n* few threads of saffron\nFor making aromatic spice blend -\n* 10 - 11 green cardamoms\n* 1 teaspoon ground mace (javetri)\n* 1/4 th teaspoon ground nutmeg (jaifal)\n* 1 heaped teaspoon garam masala powder. Recipe for homemade garam masala -\n3 MUST HAVE HOMEMADE INDIAN SPICE POWDERS | Ground Coriander Cumin \u0026 Garam Masala\nhttps://youtu.be/ciR43perZbU\n\nKEEP IN TOUCH FOOD LOVERS -\nMy email - bumbicurry@gmail.com.  Share the photos of your culinary success by emailing me. \nFacebook - https://www.facebook.com/currieswithbumbi\n🎬 Related videos -\n🎬 Lentil \u0026 Rice Recipe With Caramelized Onions + Simple Raita -\nhttps://youtu.be/KnmSE3IgJMY\n🎬 Vegetarian \u0026 Vegan Recipes -\nhttps://www.youtube.com/playlist?list=PLxgPEcdhkY4HGC40CzrMe3Itzjr2-AwUt\n🎬 Tofu Recipes -\nhttps://www.youtube.com/playlist?list=PLxgPEcdhkY4H0gkdCB1FW_tCVUMQ7ODGT\n🎬 Dal (Lentil) recipes - \nhttps://www.youtube.com/playlist?list=PLxgPEcdhkY4EAQUzhvXNs2eO6JGAqZV5C\n🎬 Pulao Biryani Recipes - \nhttps://www.youtube.com/playlist?list=PLxgPEcdhkY4HtAhDls39--WlMPAji0l8C\n\n🎼Background Music - (From YouTube Audio Library)-\n* India Fuse By French Fuse\n\n#vegetablebiryanirecipe #currieswithbumbi \nDISCLAIMER- The information provided on this channel is for general purposes only and should not be considered as professional experience. All opinions/views/suggestions expressed here are based on my personal experience of cooking which I gained for years at my own home kitchen. While making videos, I have taken into consideration all possible and required safety precautions, but still any action you take based upon the information on this channel is strictly at your own discretion and risk, and we are not liable for any harm or damage in connection after watching or trying out the content presented ing fresh green peas, add them along with other vegetables before marination.\n* 60 gm/ 2 oz green beans\n* 2 large onions \n* 1 cup plain unflavored yogurt\n* 1 teaspoon shahi jeera (black cumin seeds)\n* 1/2 teaspoon turmeric powder\n* 1 tablespoon kashmiri red chilli powder\n* 1 tablespoon ground coriander (dhania powder)\n* 20 gm ginger/ 1 tablespoon finely grated\n* 20 gm / 6 large garlic cloves/ 1 tablespoon finely grated\n* 1/3 rd cup oil\n* 1 tablespoon ghee for making curry + 2 tablespoons will go on rice while layering\n* 1 dried bay leaf\n* 2 to 3 green cardamoms\n* 1 cinnamon stick\n* 20 to 30 fresh mint leaves\n* 1 tablespoon Kewra water. Please note if using Kewra essence just use 2 to 3 drops\n* 1 to 2 teaspoons rose water \n* 3/4 th cup rice water\n* few threads of saffron\nFor making aromatic spice blend -\n* 10 - 11 green cardamoms\n* 1 teaspoon ground mace (javetri)\n* 1/4 th teaspoon ground nutmeg (jaifal)\n* 1 heaped teaspoon garam masala powder. Recipe for homemade garam masala -\n3 MUST HAVE HOMEMADE INDIAN SPICE POWDERS | Ground Coriander Cumin \u0026 Garam Masala\nhttps://youtu.be/ciR43perZbU\n\nKEEP IN TOUCH FOOD LOVERS -\nMy email - bumbicurry@gmail.com.  Share the photos of your culinary success by emailing me. \nFacebook - https://www.facebook.com/currieswithbumbi\n🎬 Related videos -\n🎬 Lentil \u0026 Rice Recipe With Caramelized Onions + Simple Raita -\nhttps://youtu.be/KnmSE3IgJMY\n🎬 Vegetarian \u0026 Vegan Recipes -\nhttps://www.youtube.com/playlist?list=PLxgPEcdhkY4HGC40CzrMe3Itzjr2-AwUt\n🎬 Tofu Recipes -\nhttps://www.youtube.com/playlist?list=PLxgPEcdhkY4H0gkdCB1FW_tCVUMQ7ODGT\n🎬 Dal (Lentil) recipes - \nhttps://www.youtube.com/playlist?list=PLxgPEcdhkY4EAQUzhvXNs2eO6JGAqZV5C\n🎬 Pulao Biryani Recipes - \nhttps://www.youtube.com/playlist?list=PLxgPEcdhkY4HtAhDls39--WlMPAji0l8C\n\n🎼Background Music - (From YouTube Audio Library)-\n* India Fuse By French Fuse\n\n#vegetablebiryanirecipe #currieswithbumbi \nDISCLAIMER- The information pro  follow these steps then you will soon master it and will be really proud of yourself. I feel this vegetable biryani tastes equally good like chicken or mutton biryani.\n🔔Please click on the link below and subscribe to Curries With Bumbi so that I can bring more new recipes for you--    / @currieswithbumbi  \n\nIngredients required for making vegetable biryani -\nFor cooking rice - Serves 3 to 4\n500 gm/1 lb/ 2 cups (standard measuring cup) of long grained Basmati rice\n2 tablespoons salt\n2 dried bay leaves\n1 cinnamon stick\n3 to 4 green cardamoms\n8 to 10 cloves\n1 tablespoon lime/lemon juice\n1 tablespoon oil\nFor making the vegetable curry and layering rice - Please note the weight of rice should be more or less equal to the weight of veggies taken.\n200 gm/7 oz cauliflower\n100 gm/ 4 oz / 1 medium to large potato\n108 gm/ 4oz/ 2 medium carrots\n30 gm/1/4 th cup frozen green peas. Add it after the vegetable curry is done if using frozen ones. If using fresh green peas, add them along with other vegetables before marination.\n60 gm/ 2 oz green beans\n2 large onions \n1 cup plain unflavored yogurt\n1 teaspoon shahi jeera (black cumin seeds)\n1/2 teaspoon turmeric powder\n1 tablespoon kashmiri red chilli powder\n1 tablespoon ground coriander (dhania powder)\n20 gm ginger/ 1 tablespoon finely grated\n20 gm / 6 large garlic cloves/ 1 tablespoon finely grated\n1/3 rd cup oil\n1 tablespoon ghee for making curry + 2 tablespoons will go on rice while layering\n1 dried bay leaf\n2 to 3 green cardamoms\n1 cinnamon stick\n20 to 30 fresh mint leaves\n1 tablespoon Kewra water. Please note if using Kewra essence just use 2 to 3 drops\n1 to 2 teaspoons rose water \n3/4 th cup rice water\nfew threads of saffron\nFor making aromatic spice blend -\n10 - 11 green cardamoms\n1 teaspoon ground mace (javetri)\n1/4 th teaspoon ground nutmeg (jaifal)\n1 heaped teaspoon garam masala powder. Recipe for homemade garam masala -\n3 MUST HAVE HOMEMADE INDIAN SPICE POWDERS | Ground Coriander Cumin \u0026 Garam Masala\n   • 3 MUST HAVE HOMEMADE INDIAN SPICE POWDERS ...  \n\nKEEP IN TOUCH FOOD LOVERS -\nMy email - bumbicurry@gmail.com.  Share the photos of your culinary success by emailing me. \nFacebook -   / currieswithbumbi  \n🎬 Related videos -\n🎬 Lentil \u0026 Rice Recipe With Caramelized Onions + Simple Raita -\n   • How To Cook PERFECT FLUFFY LENTIL \u0026 RICE W...  \n🎬 Vegetarian \u0026 Vegan Recipes -\n   • VEGETARIAN \u0026 VEGAN RECIPES  \n🎬 Tofu Recipes -\n   • TOFU RECIPES INDIAN STYLE  \n🎬 Dal (Lentil) recipes - \n   • DAL (LENTIL) \u0026 BEAN RECIPES  \n🎬 Pulao Biryani Recipes - \n   • Pulao Biryani Rice Recipes  \n\n🎼Background Music - (From YouTube Audio Library)-\nIndia Fuse By French Fuse\n\n#vegetablebiryanirecipe #currieswithbumbi \nDISCLAIMER- The information provided on this channel is for general purposes only and should not be considered as professional experience. All opinions/views/suggestions expressed here are based on my personal experience of cooking which I gained for years at my own home kitchen. While making videos, I have taken into consideration all possible and required safety precautions, but still any action you take based upon the information on this channel is strictly at your own discretion and risk, and we are not liable for any harm or damage in connection after watching or trying out the content presented in our videos.\nHave a happy and safe cooking experience","commandRuns":[{"startIndex":457,"length":24,"onTap":{"innertubeCommand":{"clickTrackingParams":"CN0DEM2rARgBIhMI5eDRp5SckAMVlJBmAh3fLCGdygEETTXPqw==","commandMetadata":{"webCommandMetadata":{"url":"/channel/UCc5O8GaMvAGjmvENEvvqZrg","webPageType":"WEB_PAGE_TYPE_CHANNEL","rootVe":3611,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"UCc5O8GaMvAGjmvENEvvqZrg","canonicalBaseUrl":"/channel/UCc5O8GaMvAGjmvENEvvqZrg"}}},"onTapOptions":{"accessibilityInfo":{"accessibilityLabel":"YouTube Channel Link: @CurriesWithBumbi"}}},{"startIndex":2152,"le rowseEndpoint":{"browseId":"UCc5O8GaMvAGjmvENEvvqZrg","canonicalBaseUrl":"/@CurriesWithBumbi"}},"channelThumbnail":{"thumbnails":[{"url":"https://yt3.ggpht.com/ytc/AIdro_lq9XMLFjBjfoJkB-BL2QVE7-R3JsUxcCUYzD0YTQ_QkRfh=s88-c-k-c0x00ffffff-no-rj"}]}}},{"expandableVideoDescriptionBodyRenderer":{"showMoreText":{"accessibility":{"accessibilityData":{"label":"Show more"}},"simpleText":"...more"},"showLessText":{"simpleText":"Show less"},"attributedDescriptionBodyText":{"content":"How To Cook Vegetable Biryani - Restaurant Style Vegetable Biryani Recipe - Perfect Vegetable Biryani\nThere are several tricks that go into making a perfect biryani. If you follow these steps then you will soon master it and will be really proud of yourself. I feel this vegetable biryani tastes equally good like chicken or mutton biryani.\n🔔Please click on the link below and subscribe to Curries With Bumbi so that I can bring more new recipes for you--    / @currieswithbumbi  \n\nIngredients required for making vegetable biryani -\nFor cooking rice - Serves 3 to 4\n500 gm/1 lb/ 2 cups (standard measuring cup) of long grained Basmati rice\n2 tablespoons salt\n2 dried bay leaves\n1 cinnamon stick\n3 to 4 green cardamoms\n8 to 10 cloves\n1 tablespoon lime/lemon juice\n1 tablespoon oil\nFor making the vegetable curry and layering rice - Please note the weight of rice should be more or less equal to the weight of veggies taken.\n200 gm/7 oz cauliflower\n100 gm/ 4 oz / 1 medium to large potato\n108 gm/ 4oz/ 2 medium carrots\n30 gm/1/4 th cup frozen green peas. Add it after the vegetable curry is done if using frozen ones. If using fresh green peas, add them along with other vegetables before marination.\n60 gm/ 2 oz green beans\n2 large onions \n1 cup plain unflavored yogurt\n1 teaspoon shahi jeera (black cumin seeds)\n1/2 teaspoon turmeric powder\n1 tablespoon kashmiri red chilli powder\n1 tablespoon ground coriander (dhania powder)\n20 gm ginger/ 1 tablespoon finely grated\n20 gm / 6 large garlic cloves/ 1 tablespoon finely grated\n1/3 rd cup oil\n1 tablespoon ghee for making curry + 2 tablespoons will go on rice while layering\n1 dried bay leaf\n2 to 3 green cardamoms\n1 cinnamon stick\n20 to 30 fresh mint leaves\n1 tablespoon Kewra water. Please note if using Kewra essence just use 2 to 3 drops\n1 to 2 teaspoons rose water \n3/4 th cup rice water\nfew threads of saffron\nFor making aromatic spice blend -\n10 - 11 green cardamoms\n1 teaspoon ground mace (javetri)\n1/4 th teaspoon ground nutmeg (jaifal)\n1 heaped teaspoon garam masala powder. Recipe for homemade garam masala -\n3 MUST HAVE HOMEMADE INDIAN SPICE POWDERS | Ground Coriander Cumin \u0026 Garam Masala\n   • 3 MUST HAVE HOMEMADE INDIAN SPICE POWDERS ...  \n\nKEEP IN TOUCH FOOD LOVERS -\nMy email - bumbicurry@gmail.com.  Share the photos of your culinary success by emailing me. \nFacebook -   / currieswithbumbi  \n🎬 Related videos -\n🎬 Lentil \u0026 Rice Recipe With Caramelized Onions + Simple Raita -\n   • How To Cook PERFECT FLUFFY LENTIL \u0026 RICE W...  \n🎬 Vegetarian \u0026 Vegan Recipes -\n   • VEGETARIAN \u0026 VEGAN RECIPES  \n🎬 Tofu Recipes -\n   • TOFU RECIPES INDIAN STYLE  \n🎬 Dal (Lentil) recipes - \n   • DAL (LENTIL) \u0026 BEAN RECIPES  \n🎬 Pulao Biryani Recipes - \n   • Pulao Biryani Rice Recipes  \n\n🎼Background Music - (From YouTube Audio Library)-\nIndia Fuse By French Fuse\n\n#vegetablebiryanirecipe #currieswithbumbi \nDISCLAIMER- The information provided on this channel is for general purposes only and should not be considered as professional experience. All opinions/views/suggestions expressed here are based on my personal experience of cooking which I gained for years at my own home kitchen. While making videos, I have taken into consideration all possible and required safety precautions, but still any action you take based upon the information on this channel is strictly at your own discretion and risk, and we are not liable for any harm or damage in connection after watching or trying out the content presented in our videos.\nHave a happy and safe cooking experience","commandRuns":[{"startIndex":457,"length":24,"onTap":{"innertubeCommand":{"clickTrackingParams":"CB0Q040EGAQiEwjl4NGnlJyQAxWUkGYCHd8sIZ3KAQRNNc-r","commandMetadata":{"webCommandMetadata":{"url":"/channel/UCc5O8GaMvAGjmvENEvvqZrg","webPageType":"WEB_PAGE_TYPE_CHANNEL","rootVe":3611,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"UCc5O8GaMvAGjmvENEvvqZrg","canonicalBaseUrl":"/channel/UCc5O8GaMvAGjmvENEvvqZrg"}}},"onTapOptions":{"accessibilityInfo":{"accessibilityLabel":"YouTube Channel Link: @CurriesWithBumbi"}}},{"startIndex":2152,"length":52,"onTap":{"innertubeCommand":{"clickTrackingParams":"CB0Q040EGAQiEwjl4NGnlJyQAxWUkGYCHd8sIZ3KAQRNNc-r","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=ciR43perZbU","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"ciR43perZbU","startTimeSeconds":0,"watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr2---sn-gwpa-h55ee.googlevideo.com/initplayback?source=youtube\u0026oeis=1\u0026c=WEB\u0026oad=3200\u0026ovd=3200\u0026oaad=11000\u0026oavd=11000\u0026ocs=700\u0026oewis=1\u0026oputc=1\u0026ofpcc=1\u0026siu=1\u0026msp=1\u0026odepv=1\u0026id=722478de97ab65b5\u0026ip=2409%3A40f4%3A14%3Ac14c%3A8cd5%3Aa86f%3Ac1ae%3Ab6d8\u0026vip=2001%3A4860%3A4802%3A32%3A%3A77\u0026initcwndbps=1011250\u0026mt=1760185760\u0026oweuc="}}}}}},"onTapOptions":{"accessibilityInfo":{"accessibilityLabel":"YouTube Channel Link: 3 MUST HAVE HOMEMADE INDIAN SPICE POWDERS | Ground Coriander Cumin \u0026 Garam Masala"}}},{"startIndex":2338,"length":22,"onTap":{"innertubeCommand":{"clickTrackingParams":"CB0Q040EGAQiEwjl4NGnlJyQAxWUkGYCHd8sIZ1I3Jv00NSutscOygEETTXPqw==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbW05bkZ2d2x6enhYTkhHeW9ZS3ZLQ3oxSUtmQXxBQ3Jtc0tubzBfVENZS2pHakJKUExRZ01lQWd5eFhlcUVOZk
